Hola! Estoy teniendo problemas para hacer un componente multistep con react y tailwindcss.
El problema es que la condición pasada por las props no activa la alteración del estado. No entiendo si es un problema con tailwind o si no estoy haciendo de la manera correcta. No lo veo como arreglar...
Si alguién puede ayudarme, quedaría muy agradecido :sweat_smile:
```// ----------------------------------------------------------------
// Not working. This line is the problem:
// ${currentStep &gt;= step ? setIsActive(true) : setIsActive(false)}
// The condition is not firing setIsActive().

import { useState } from "react"

interface MultistepsProps {
  size: number
  currentStep?: number
}

export const Multistep = ({ size, currentStep = 1 }: MultistepsProps) =&gt; {
  const [isActive, setIsActive] = useState(false)  

  return (
    &lt;div className='w-full py-4 flex flex-col gap-2'&gt;
      &lt;p className='font-bold'&gt;
        Step {currentStep} of {size}
      &lt;/p&gt;
      &lt;div className='flex gap border'&gt;
        {Array.from({ length: size }, (_, i) =&gt; i + 1).map(step =&gt; (
          &lt;div
            key={step}
            className={`
              w-full h-2 border rounded
              ${isActive ? 'bg-violet-600' : 'bg-violet-400'}
              ${(currentStep &gt;= step) ? () =&gt; setIsActive(true) : () =&gt; setIsActive(false)}
            `}
          /&gt;
        ))}
      &lt;/div&gt;
    &lt;/div&gt;
  )
}```

