              ${isActive ? 'bg-violet-600' : 'bg-violet-400'}
              ${(currentStep &gt;= step) ? () =&gt; setIsActive(true) : () =&gt; setIsActive(false)}
            `}
          /&gt;
        ))}
      &lt;/div&gt;
