```function addToFrontOfNew(arr, element) {
    let newarray = [element];
    for (let e of arr) {
        newarray.push(e)
    }
    return newarray;
}

let input = [1, 2];
let output = addToFrontOfNew(input, 3);
console.log(output); // --&gt; [3, 1, 2];
console.log(input); // --&gt; [1, 2]```

