Saludos. Tengo algunas consultas relacionadas con algunos de los ejercicios del `JAVASCRIPT-BEGINNER-EXERCISES-TUTORIAL`. Helas aquí:

*1.- `19 Random Colors Loop`*

Este ejercicio he tratado de resolverlo de tres formas distintas:

     1.- La primera, creando y retornando un objeto que asocie a cada estudiante su color. He aquí el código:

```function getColor(colorNumber) {
  switch (colorNumber) {
    case 1: return "red";
		case 2: return "yellow";
		case 3: return "blue";
		case 4: return "green";
		default: return "black";
  }
}

function getAllStudentColors(students) {
  var students = prompt("How many students do you need to assign a color to?");
  students = parseInt(students);
  var colorPerStudent = {};

  for (let i = 0; i &lt; students; i++) {
    chosenColor = getColor(Math.floor(Math.random() * 5));
    colorPerStudent[`Student #${[i+1]}`] = chosenColor;
  }
  return colorPerStudent;
}

console.log(getAllStudentColors()); // Devuelve```
Por obvio, sí, pide al usuario que introduzca un número en lugar de tomar ese número de ninguna parte. Cuando el usuario introduce el número, en realidad «la máquina» toma una `string`, de ahí la necesidad de convertirlo en un `integer`. Pero bueno, a lo que vamos: la función devuelve el objeto buscado— compuesto, digamos, de los 10 estudiantes que propone el ejercicio; es decir:

```How many students you need to assign a color to?&gt; 10```
Devuelve:

```{
  'Student #1': 'red',
  'Student #2': 'blue',
  'Student #3': 'blue',
  'Student #4': 'red',
  'Student #5': 'yellow',
  'Student #6': 'green',
  'Student #7': 'black',
  'Student #8': 'red',
  'Student #9': 'green',
  'Student #10': 'green'
}```
A la hora de ejecutar el test del ejercicio, obviamente buscando un resultado distinto a un objeto, devuelve:

```✓ (done) 0. function getColor() should exist
✓ (done) 1. function getAllStudentColors() should exist
x (fail) 2. console.log() function should be called 10 times
x (fail) 3. console.log() function should be called with a string
✓ (done) 4. console.log() function should not be called with argument black ```

