Text:
Hi there.

In `081 addToFrontOfNew` from `Master-Javascript-Programming-Exercises`, the expected output given the data provided by the exercise is:

```let input = [1, 2];
let output = addToFrontOfNew(input, 3);
console.log(output); // --&gt; [3, 1, 2];
console.log(input); --&gt; [1, 2]```
However, one of the test corresponding to this exercise states that:

```● The returned array should have one more item than the original one.

    expect(received).toBeGreaterThan(expected)

    Expected: &gt; 3
    Received:   3```
Which is funny, because the code of the test is clear:

```test('The returned array should have one more item than the original one .', () =&gt; {
  let input = [1, 2];
  let output = addToFrontOfNew(input, 3);
  expect(output.length).toBeGreaterThan(input.length);
});```
This is, the `output.length` of my result equals 3, where as `input.length` is still 2.

Thus, `output.length` is greater than `input.length`.

`&gt; 3` should not be expected, since adding one element to an `array.length === 2` will yield an `array.length === 3`. Therefore, this one test seems to be doomed to always fail.

Am I any right on this?

