Given the exposition of the problem,  the next code will not only change the `output`, but also the `input`:

```function addToFrontOfNew(arr, element) {
  arr.unshift(element);
  return arr;
} 

  let input = [1, 2];
  let output = addToFrontOfNew(input, 3);
  console.log(output); // --&gt; [3, 1, 2];
  console.log(input); // --&gt; [3, 1, 2]```
So the problem is not getting to the expected result for the `output` of this function. The problem is the fact that no matter what I try, `input` changes as `output` gets built within the function.

