Text:
A loop.

```function addToFrontOfNew(arr, element) {
  const newArr = [];
  for (let i = 0; i &lt; arr.length; i++) {
    newArr.push(arr[i]);
  }
  newArr.unshift(element);
  return newArr
}  

let input = [1, 2];
let output = addToFrontOfNew(input, 3);
console.log(output); // --&gt; [3, 1, 2];
console.log(input); // --&gt; [1, 2]```
:innocent: :innocent:  :innocent:

