    for (let i = 0; i &lt; arr.length; i++) {
        obj[arr[i]] = (obj[arr[i]] || 0) + 1;
    }
    return obj;
}```
Now, I am amazed at the use of

```obj[arr[i]] = (obj[arr[i]] || 0) + 1;```
How does "the machine" interprets this? Something like...

&gt; Assign the key `arr[i]` to `obj` with a value of  `arr[i]+1` _*or*_ `0+1`
If that was to be the case, the questions would be:

1. What does `arr[i]+1` mean in the right term of that statement?
2. How does that _*or*_ (`||`) work in that context?
3. How does the whole statement get interpreted?
:face_with_spiral_eyes: :face_with_spiral_eyes: :face_with_spiral_eyes:

