Hi there :slightly_smiling_face:

Why the following code works with `.map()`, but not with `.forEach()`?

```let obj = {
  key: [2, 1, 5]
};

function getSquaredElementsAtProperty(obj, key) {
  if (!Array.isArray(obj.key)) {
    return [];
  } else if (obj.key.length === 0) {
    return [];
  } else {
    return obj.key.map(x =&gt; x * x);
    }
}

let output = getSquaredElementsAtProperty(obj, 'key');
console.log(output); // --&gt; [4, 1, 25] --&gt; It works!```
```let obj = {
  key: [2, 1, 5]
};

function getSquaredElementsAtProperty(obj, key) {
  if (!Array.isArray(obj.key)) {
    return [];
  } else if (obj.key.length === 0) {
    return [];
  } else {
    return obj.key.forEach(x =&gt; x * x);
    }
}

let output = getSquaredElementsAtProperty(obj, 'key');
console.log(output); // --&gt; undefined --&gt; It does not work :-(```

