Hello, everyone, I am finding this exercise (from Master JavaScript, pre-work) quite difficult and I've done so much research and tried many things but my brain is melting.

_Instructions:_ 
_Write a function called `getElementsAfter`._
_Given an array and an index, `getElementsAfter` returns a new array with all the elements after (but not including) the given index._

```/* my code /*

function getElementsAfter(array, n) {

  array = ['a', 'b', 'c', 'd', 'e'];

  let array1 = array.splice(n, array.length);
  let array2 = array1.push(array1);

  return array2;

}```
I've tried combinations of .slice(), and .splice() and then just tried .splice() only since I'm asked to return a new array. It is difficult to try to piece things together (no pun intended) with the last part of the instructions. I understand I have to return only the elements located after the given index... I just can't seem to express it on my code :melting_face:
I appreciate any guidance, cheers!

