```import React, { useEffect } from "react";
import PlanetCard from "./planetcard.jsx";
import { useState } from "react";
import Table from 'react-bootstrap/Table';


export const PlanetTable = () =&gt; {
	const [PlanetList, setPlanetList] = useState([])

	useEffect(() =&gt; {
		fetch(`https://www.swapi.tech/api/planets`)
		.then(response =&gt; response.json())
		.then(data =&gt;{
			setPlanetList(data.results)
			console.log(data)
		})
	}, [] )
	return (
		&lt;&gt;
		&lt;Table responsive&gt;
      &lt;thead&gt;
        &lt;tr&gt;
		{PlanetList.map ((planet, index) =&gt; (
			&lt;th&gt;{planet.name}&lt;/th&gt;
		))}
        &lt;/tr&gt;
      &lt;/thead&gt;
      &lt;tbody&gt;
        &lt;tr&gt;
		{PlanetList.map ((planet, index) =&gt; (
			fetch(`https://www.swapi.tech/api/planets/index`)
			.then(response =&gt; response.json())
			.then(data =&gt;{
				console.log(data)
				{&lt;PlanetCard planetname={data.results.name} planetpopulation={data.results.population} planetterrain={data.results.terrain}/&gt;}
			})

		))}
        &lt;/tr&gt;

      &lt;/tbody&gt;
    &lt;/Table&gt;
		&lt;/&gt;

	);```
};

