!DOCTYPE html
&lt;html&gt;
    &lt;head&gt;
        &lt;meta charset="utf-8" /&gt;
        &lt;meta name="viewport" content="width=device-width" /&gt;
        &lt;link rel="stylesheet" type="text/css" href="./styles.css" /&gt;
        &lt;title&gt;06 Practicing Rules&lt;/title&gt;
    &lt;/head&gt;

    &lt;body&gt;
        &lt;div style="width: 640px"&gt;
            &lt;h1&gt;The learning essay&lt;/h1&gt;
            &lt;h2&gt;3 reasons you know you are learning&lt;/h2&gt;
            &lt;p id="id1"&gt;
                We are going to explain in this pharagraph the 3 most comon signs that you should look into yourself to recognize if you are learning.
            &lt;/p&gt;
            &lt;ol&gt;
                &lt;li&gt;You are able to complete the exercises by yourself.&lt;/li&gt;
                &lt;li&gt;You understand what the teacher is talking about&lt;/li&gt;
                &lt;li&gt;Your are able to have conversations about the topic&lt;/li&gt;
            &lt;/ol&gt;
            &lt;h2&gt;3 reasons you know love what you are learning&lt;/h2&gt;
            &lt;ul&gt;
                &lt;li&gt;Time passes fast.&lt;/li&gt;
                &lt;li&gt;You are anxious to finish this excercise and start the next one.&lt;/li&gt;
                &lt;li&gt;Is 12am and you don't want to go to sleep.&lt;/li&gt;
            &lt;/ul&gt;
            &lt;p id="id2"&gt;
                If you can't sleep, what better than watching videos of cats?
                &lt;a href="https://www.youtube.com/watch?v=WEgWMOzQ8IE"&gt;click here&lt;/a&gt;
            &lt;/p&gt;
        &lt;/div&gt;
    &lt;/body&gt;
&lt;/html&gt;

let counter =0;
const Home = () =&gt; {

    const [newTask, setNewTask] = useState([])
    const validate = (e) =&gt; {
        if(e.key ==='Enter'){
            setNewTask(prev =&gt; [...prev, e.target.value])
            e.target.value = null;
            counter++
        }
    }


const deleteTask = (newTas) =&gt; {
     setNewTask (newTask.filter(p =&gt; p !=newTas))
     counter --
}
  return (
    &lt;div className="container"&gt;
        &lt;div className="card"&gt;
        &lt;div className="card-body"&gt;
            &lt;h5&gt; Task List.&lt;/h5&gt;
            &lt;input  type="text" className="form-control" placeholder="Enter task" onKeyDown={e =&gt; validate(e)}/&gt;
            &lt;p&gt;&lt;/p&gt;
            &lt;ul className="list-group" &gt;
                &lt;li id="first" className="list-group-item"&gt; Added tasks:  {counter&lt;1? "No Tasks, add task": counter}&lt;/li&gt;&lt;p&gt;&lt;/p&gt;
            &lt;/ul&gt;
            {newTask &amp;&amp; newTask.map ((newTas) =&gt; {
                return &lt;ul className="list-group"&gt;
                            &lt;li key={newTas.toString()} onClick ={() =&gt; deleteTask(newTas.toString())}  className="list-group-item"&gt;{newTas}  &lt;button  type="button" class="btn-close" aria-label="Close"&gt;&lt;/button&gt;&lt;/li&gt;&lt;p&gt;&lt;/p&gt;
                        &lt;/ul&gt;
            })
            }
        &lt;/div&gt;
        &lt;/div&gt;
    &lt;/div&gt;
  );
};

